import Meme from '../meme/index'
import './Header.css'
export default function Header() {
  return (
<div className='body'>
   
      <Meme
      title="High five, Hyperlink!"
      image="img/hyperlink.webp"
      />
       <Meme
      title="Sorry, bro."
      image="img/sorry_bro.webp"
      />
    
</div>
  );
}
